import React from "react";
import { Routes, Route, Link} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <ul className="bottom_menu">
        <li>
          <Link>
            <img />
          </Link>
        </li>
      </ul>
      <Routes>
        <Route path="/" />
        <Route path="/store" />
        <Route path="/quests" />
        <Route path="/profile" />
      </Routes>
    </div>
  );
}

export default App;
